import React from "react";
import {useEffect, useState} from "react";

const List = () =>{
    const [initialState, setInitialState] = useState([])
    useEffect(() =>{
        fetch("/api/").then(res => {
            if(res.ok){
                return res.json()
            }
        }).then(jsonResponse =>setInitialState(jsonResponse))
    })
    console.log(initialState)
    return(<div>AAAAAAA </div>)
}

export default List;
